import { ADD, ADD_NUMBER, RESET, SUB } from "./actionTypes";

export function add(): {type: string} {
    return {
        type: ADD
    }
}

export function sub(): {type: string} {
    return {
        type: SUB
    }
}

export function addNumber(number: number): {type: string} {
    return {
        type: ADD_NUMBER,
        payload: number
    }
}

export function reset() {
    return {
        type: RESET
    }
}
